import React from 'react';

function Usersdisplay(props) {

    const { users } = props;
    return (
<div className="users-container">
  {users.map((users, index) => {
    if (index % 8 === 0) {
      return (
        <div key={index / 8} className="user-group">
          {users.slice(index, index + 8).map((users) => (
            <div key={users.id} className="user">
              <img src={users.ppicture} height="100px" width="100px" alt={users.name} />
              <p>{users.name} {users.firstname}</p>
              <p>{users.dob}</p>
              <p>{users.orientation}</p>
            </div>
          ))}
        </div>
      );
    } else {
      return null;
    }
  })}
  {users.length % 8 !== 0 && (
    <div key={users.length / 8 + 1} className="user-group">
      {users.slice(users.length - (users.length % 8)).map((users) => (
        <div key={users.id} className="user">
          <img src={users.ppicture} height="100px" width="100px" alt={users.name} />
          <p>{users.name} {users.firstname}</p>
          <p>{users.dob}</p>
          <p>{users.orientation}</p>
        </div>
      ))}
    </div>
  )}
</div>
    );
};

export default Usersdisplay;
